	.twidget {
		width:48%;
		height:443.188px;
		margin-top:0px;
	}
	iframe#twitter-widget-0{
		min-height:150px !important;
		height:443.188px !important;
	}
}









        	Event Information

La  Asociación de Estudios Latinoamericanos (LASA, por sus siglas en inglés) le da la bienvenida al sitio de Latin America Research Commons (LARC), el primer portal de acceso abierto dedicado a investigaciones de vanguardia, relacionadas con América Latina.
&nbsp;


LARC tiene el objetivo de contribuir a la difusión del conocimiento a través de la publicación de libros inéditos y publicaciones académicas de todas las disciplinas relacionadas a los Estudios Latinoamericanos.
&nbsp;


Sus principales lenguas de publicación son el español y el portugués, y su objetivo es garantizar que los investigadores alrededor del mundo puedan encontrar y acceder a la información que necesiten, sin barreras económicas o geográficas.
&nbsp;


Bajo la orientación editorial de su distinguido comité editorial, en LARC se publican libros sujetos a normas de rigor académico y una exigente evaluación hecha por pares.
&nbsp;


